INSERT INTO `tbx_status` (`INDEX_STATUS`, `NAMA_STATUS`, `KET_STATUS`) VALUES
(1, 'Manifested', 'Paket yang akan dikirim sudah diterima di kantor SiCepat dan menunggu proses pengiriman.'),
(2, 'On Transit', 'Paket yang dikirim sedang transit di kota lain, dan akan segera dijadwalkan untuk dikirim ke kota tujuan.'),
(3, 'On Process', 'Paket sedang dalam proses pengiriman.'),
(4, 'Received on Destination', 'Paket sudah diterima kantor perwakilan SiCepat di kota tujuan, tapi belum dikirim ke alamat tujuan.'),
(5, 'Delivered', 'Paket sudah diantar dan diterima di alamat tujuan.'),
(6, 'Antar Ulang (AU)', 'Paket sudah dibawa oleh pengantar paket tapi karena belum sempat dikirimkan pada hari sebelumnya maka akan dikirim ulang pada hari berikutnya.'),
(7, 'Bad address (BA)', 'Alamat yang dituju tidak jelas atau ada kesalahan penulisan alamat, nomor jalan/rumah/RT/RW, kode pos dan sebagainya. Nomor telepon penerima sudah dihubungi tapi tidak diangkat, selanjutnya barang tersebut dibawa kembali oleh kurir.'),
(8, 'Misroute', 'Pengiriman paket salah jalur atau salah tujuan. SiCepat akan langsung membetulkan jalur pengiriman paket yang benar.'),
(9, 'Closed Once Delivery Attempt', 'Paket telah diantar sampai ke alamat tujuan, tetapi alamat tersebut salah atau kosong. Mohon hubungi kantor perwakilan SiCepat jika muncul status ini.'),
(10, 'Cnee Unknown', 'Nama penerima paket tidak dikenali di alamat tujuan atau penerima ternyata tidak tinggal di alamat tujuan. Kemungkinan disebabkan oleh kesalahan penulisan nama atau alamat saat mengirim paket.'),
(11, 'NTH (Not Home)', 'Paket sudah diantar ke alamat tujuan tapi tidak ada orang yang menerima.');
